import styles from '../Dashboard.module.css'

export function Summary(){
    return(
        <main className={styles.dash}>
         <div>
            <header>
                <p>Entradas</p>
                <img src='/iconevial.svg'/>
            </header>
         </div>
        </main>
    )
}
